
export interface QuotationData {
  coverPoster?: string | null;
  date: string;
  client?: string;
  consultant?: string;
  project?: string;
  plotNo?: string;
  quotationNo?: string;
  duration?: string;
  items: QuotationItem[];
  materials?:string[];
  subtotal: number;
  vat: number;
  total: number;
  totalInWords?:string;
  message?: string;
  standardMethod?: string;
  paymentTerms?: string;
  excludingWork?: string;
  conditions?: string[];
  companyName?: string;
  companyLogo?: string;

  // ── NEW fields added for currency & tax support ────────────────────────
  currencySymbol: string;     // 'AED' or '₹'
  taxLabel: string;           // 'VAT' or 'GST'
  taxRatePercent: string;     // '5%' or '18%'
}

const DEFAULT_COVER_POSTER ="data:image/jpeg;base64,";
export const quotationHTML = (data: QuotationData): string => {

  const coverPoster =
    data.coverPoster && data.coverPoster.length > 0
      ? data.coverPoster
      : DEFAULT_COVER_POSTER;

  // Format items rows
  const tableRows = data.items
    .map(
      (item, index) => `
      <tr style="background-color: #ffffff;">
        <td style="text-align:center;">${index + 1}</td>
        <td>${item.desc || ''}</td>
        <td style="text-align:right;">${item.qty || 0}</td>
        <td style="text-align:right;">${data.currencySymbol} ${Number(item.rate || 0).toFixed(2)}</td>
        <td style="text-align:right; font-weight:bold;">${data.currencySymbol} ${Number((item.qty || 0) * (item.rate || 0)).toFixed(2)}</td>
      </tr>
    `
    )
    .join('');
    data.companyLogo = "data:image/png;base64,"

  const materials = data.materials || [];
  // Materials section (unchanged)
  const materialTableHTML = data.materials.length > 0 ? `
    <div class="page-break"></div>

    <div class="area-card">
      <div class="area-title">Material Details</div>

      <table class="detail-table">
        <thead>
          <tr>
            <th style="width:25%">PRODUCT</th>
            <th style="width:25%">NAME</th>
            <th style="width:50%">DESCRIPTION</th>
          </tr>
        </thead>

        <tbody>
          ${data.materials?.map(material => `
            <tr>

              <!-- IMAGE -->
              <td style="text-align:center;">
                <img
                  src="${material.images}"
                  style="
                    width:120px;
                    height:120px;
                    object-fit:contain;
                  "
                />
              </td>

              <!-- NAME -->
              <td style="
                text-align:center;
                font-weight:bold;
                font-size:16px;
                color:#8B6F47;
              ">
                ${material.name}
              </td>

              <!-- DESCRIPTION -->
              <td style="line-height:1.6;">
                ${material.description}
              </td>

            </tr>
          `).join("")}
        </tbody>

      </table>

    </div>
  ` : "";

  const conditionsList = data.conditions?.length > 0
    ? data.conditions.map(c => `<li style="margin-bottom:6px;">${c}</li>`).join('')
    : '<li>No special conditions specified.</li>';
  

  return `
<html>
<head>
  <meta charset="utf-8" />
  <style>
    body { 
      font-family: Arial, Helvetica, sans-serif; 
      padding: 32px; 
      color: #222; 
      background: #fff; 
      margin: 0; 
      font-size: 13px; 
    }
    .header { 
      text-align: center; 
      border-bottom: 3px solid #8B6F47; 
      padding-bottom: 20px; 
      margin-bottom: 30px; 
    }
    .logo { height: 100px; margin-bottom: 10px; }
    .company { font-size: 32px; font-weight: bold; color: #8B6F47; letter-spacing: 1px; }
    .subtitle { font-size: 16px; color: #0a0a0a; margin-top: 4px; }
    .info { 
      margin-bottom: 30px; 
      font-size: 15px; 
      line-height: 1.6; 
      background: #f8f9fa; 
      padding: 12px; 
      border-radius: 6px; 
    }
    .area-card { 
      margin-top:10px;
      margin-bottom: 32px; 
      border: 1px solid #e0e0e0; 
      border-radius: 8px; 
      overflow: hidden; 
      box-shadow: 0 2px 6px rgba(0,0,0,0.08); 
    }
    .area-title { 
      background: #8B6F47; 
      color: white; 
      padding: 14px 20px; 
      font-size: 18px; 
      font-weight: bold; 
    }
    table { width: 100%; border-collapse: collapse; }
    .detail-table th, .detail-table td { 
      border: 1px solid #ddd; 
      padding: 10px 12px; 
      text-align: left; 
    }
    .detail-table th { 
      background: #fdfdfe; 
      font-weight: bold; 
      color: #8B6F47; 
    }
    .detail-table tr:nth-child(even) { background-color: #ffffff; }
    .section-title { 
      font-size: 16px; 
      font-weight: bold; 
      margin: 20px 0 10px; 
      color: #0f0f0f; 
      padding-left: 20px; 
    }
    .totals { 
      background: #e8f5e9; 
      padding: 14px 20px; 
      text-align: right; 
      font-weight: bold; 
      font-size: 17px; 
      color: #2e7d32; 
      border-top: 2px solid #81c784; 
    }
    .grand-total { font-size: 19px; margin-top: 8px; }
    .message-box { padding: 0 20px 20px; white-space: pre-wrap; line-height: 1.5; }
    ul { padding-left: 30px; margin: 12px 0 20px; }
    .page-break { page-break-before: always; }
    .payment-summary { 
      margin-top: 40px; 
      padding: 24px; 
      background: #fff8e1; 
      border: 2px solid #C19A6B; 
      border-radius: 10px; 
    }
    .payment-summary table td { 
      padding: 12px; 
      border-bottom: 1px solid #C19A6B; 
      font-size: 15px; 
    }
    .payment-summary .total-row { 
      font-weight: bold; 
      font-size: 18px; 
      padding-top: 16px; 
    }
    .footer { 
      background:#8B6F47; 
      margin-top: 60px; 
      text-align: center; 
      font-size: 16px; 
      color: #fbfafa; 
      border-top: 1px solid #eee; 
      padding-top: 20px; 
    }
    .materials-grid {
      display: flex;
      flex-wrap: wrap;
      gap: 24px;
      margin: 20px 0;
    }
    .material-item {
      flex: 0 0 calc(33.333% - 16px);
      max-width: calc(33.333% - 16px);
      display: flex;
      flex-direction: column;
      background: #fff;
      border: 1px solid #e0e0e0;
      border-radius: 8px;
      overflow: hidden;
      box-shadow: 0 2px 5px rgba(0,0,0,0.06);
      min-height: 280px;
    }
    .material-content {
      padding: 12px 14px;
      flex: 1;
    }
    .material-name {
      font-size: 16px;
      font-weight: bold;
      color: #8B6F47;
      margin-bottom: 10px;
    }
    .material-desc {
      font-size: 13px;
      color: #444;
      line-height: 1.5;
    }
    .material-image-area {
      padding: 0 12px 12px;
      text-align: center;
    }
    .material-images {
      display: flex;
      flex-wrap: wrap;
      gap: 10px;
      justify-content: center;
    }
    .material-img {
      width: 140px;
      height: 140px;
      object-fit: cover;
      border-radius: 6px;
      border: 1px solid #eee;
    }
    .no-image {
      height: 140px;
      display: flex;
      align-items: center;
      justify-content: center;
      color: #999;
      font-style: italic;
      font-size: 13px;
    }
    .materials-grid::after {
      content: "";
      flex: auto;
    }
    
    .section-block {
      page-break-inside: avoid;
      break-inside: avoid;
      margin-top: 30px;
    }

  </style>
</head>
<body>

  <!-- Cover Poster (full page if provided) -->
  ${coverPoster ? `
    <div style="width:100%; height: 95vh; page-break-after:always;">
      <img src="${coverPoster}" style="width:100%; height:100%; object-fit:cover;" alt="Project Cover"/>
    </div>
  ` : ''}

  <div class="header">
    <img class="logo" src="${data.companyLogo || 'data:image/png;base64,YOUR_BASE64_LOGO'}" alt="Logo"/>
    <div class="company">${data.companyName || 'ASSAQF TECHNICAL SERVICES L.L.C'}</div>
    <div class="subtitle">Gypsum & Interior Works</div>
  </div>

  <div class="info">
    <p><b>Date:</b> ${data.date}</p>
    <p><b>Client:</b> ${data.client || ""}</p>
    <p><b>Consultants / Main Contractor:</b> ${data.consultant || "—"}</p>
    <p><b>Project:</b> ${data.project || ""}</p>
    <p><b>Plot No:</b> ${data.plotNo || "—"}</p>
    <p><b>Quotation No:</b> ${data.quotationNo || "—"}</p>
    <p><b>Duration Time:</b> ${data.duration || "—"}</p>
  </div>

  <!-- Main quotation content card -->
  <div class="area-card">
    <div class="area-title">Quotation</div>
    <div style="padding:20px;">

      ${data.message ? `
        <div style="margin-bottom:25px;">
          <div class="message-box">${data.message}</div>
        </div>
      ` : ''}
      ${data.standardMethod ? `
        <div style="margin-bottom:25px;">
          <div class="section-title">
            This is the standard method we follow for our gypsum ceiling work
          </div>
          <div class="message-box">${data.standardMethod}</div>
        </div>
      ` : ''}

      <table class="detail-table">
        <thead>
          <tr>
            <th>No</th>
            <th>Description</th>
            <th>Qty</th>
            <th>Rate (${data.currencySymbol})</th>
            <th>Total (${data.currencySymbol})</th>
          </tr>
        </thead>
        <tbody>${tableRows}</tbody>
      </table>

      <div class="totals section-block">
        <div>Subtotal: ${data.currencySymbol} ${Number(data.subtotal || 0).toFixed(2)}</div>
        <div>${data.taxLabel} (${data.taxRatePercent}): ${data.currencySymbol} ${Number(data.vat || 0).toFixed(2)}</div>
        <div class="grand-total">Grand Total: ${data.currencySymbol} ${Number(data.total || 0).toFixed(2)}</div>
      </div>

      ${data.paymentTerms ? `
        <div class="section-block page-break-before">
          <div class="section-title">Payment Terms</div>
          <div class="message-box">${data.paymentTerms}</div>
        </div>
      ` : ''}

      <div class="section-block">
        <div class="section-title">Conditions</div>
        <ul>${conditionsList}</ul>
      </div>

      ${data.excludingWork ? `
        <div class="section-block">
          <div class="section-title">Excluding Work</div>
          <div class="message-box">${data.excludingWork}</div>
        </div>
      ` : ''}

    </div>
  </div>
  
  <!-- Summary -->
  <div class="payment-summary">
    <div style="font-size:20px; font-weight:bold; color:#ef6c00; margin-bottom:20px; text-align:center;">
      Quotation Summary
    </div>
    <table style="width:100%;">
      <tr>
        <td style="font-weight:bold;">Grand Total:</td>
        <td style="text-align:right; font-weight:bold;">${data.currencySymbol} ${Number(data.total || 0).toFixed(2)}</td>
      </tr>
      <tr>
        <td style="margin-top:5px; font-style:italic; font-weight:bold;">In Words:</td>
        <td style="text-align:right; font-weight:bold;">${data.totalInWords}</td>
      </tr>
    </table>
  </div>

  <!-- Materials -->
  
  ${materialTableHTML}

</body>
</html>
  `;
};